export default function TodoApp () {
    return (
        <div className="TodoApp">
            Todo Management App
            <Login/>
        </div>
    );
}

function Login () {
    return (
        <div className="LoginForm">
            Login Component
        </div>
    );
}

function Welcome () {
    return (
        <div className="WelcomeForm">
            Welcome Component
        </div>
    );
}
